    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="col-6 col-md-4 rounded jumpotron bg-white ">
        <div className="justify-content-center">
          <i
            style={{ fontSize: "25px", color: "pink" }}
            class="fas circle fa-chart-pie mr-auto"
          ></i>
        </div>
        <h3 className="h2 font-weight-bold text-center"> Service Tag Name</h3>
